import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaCoins } from 'react-icons/fa';

const TokenCreation = () => {
  const [tokenName, setTokenName] = useState('');
  const [tokenDescription, setTokenDescription] = useState('');
  const [tokenSupply, setTokenSupply] = useState('');
  const [tokenType, setTokenType] = useState('Burnable');
  const [tokenDecimals, setTokenDecimals] = useState(0);

  const [error, setError] = useState('');
  const [tokens, setTokens] = useState([]);
  const [loading, setLoading] = useState(true);

  const API = 'https://profitpilot-backend.onrender.com/api/token';
  const authToken = localStorage.getItem('token');

  // Fetch tokens on mount
  useEffect(() => {
    const fetchTokens = async () => {
      try {
        const res = await axios.get(API, {
          headers: { Authorization: `Bearer ${authToken}` },
        });

        const tokensData = Array.isArray(res.data) ? res.data : res.data.tokens;
        setTokens(tokensData);
      } catch (err) {
        console.error('Fetch error:', err);
        setError('Failed to load tokens');
      } finally {
        setLoading(false);
      }
    };

    fetchTokens();
  }, []);

  const handleCreateToken = async () => {
    setError('');
    if (!tokenName.trim()) {
      return setError('Token name is required');
    }

    try {
      const res = await axios.post(
        API,
        { name: tokenName }, // Only send tokenName
        {
          headers: { Authorization: `Bearer ${authToken}` },
        }
      );

      const tokensData = Array.isArray(res.data) ? res.data : res.data.tokens;
      setTokens(tokensData);
      setTokenName('');
      setTokenDescription('');
      setTokenSupply('');
      setTokenType('Burnable');
      setTokenDecimals(0);
    } catch (err) {
      console.error('Create error:', err);
      const msg = err?.response?.data?.msg || 'Error creating token';
      setError(msg);
    }
  };

  return (
    <div className="text-white p-4">
      <h2 className="text-3xl font-bold text-orange-500 flex items-center gap-2">
        <FaCoins /> My Tokens
      </h2>

      {loading ? (
        <p className="mt-4 text-gray-400">Loading...</p>
      ) : tokens.length === 0 ? (
        <p className="mt-4 text-gray-400">No tokens yet. Create your first token!</p>
      ) : (
        <ul className="mt-4 space-y-2">
          {tokens.map((token, index) => (
            <li key={index} className="text-lg text-gray-300">
              🔹 {token.name}
            </li>
          ))}
        </ul>
      )}

      <div className="mt-6 space-y-3">
        <input
          type="text"
          placeholder="Token Name"
          value={tokenName}
          onChange={(e) => setTokenName(e.target.value)}
          className="p-2 rounded bg-[#111] border border-gray-700 text-white w-full"
        />

        <input
          type="text"
          placeholder="Description (Visual Only)"
          value={tokenDescription}
          onChange={(e) => setTokenDescription(e.target.value)}
          className="p-2 rounded bg-[#111] border border-gray-700 text-white w-full"
        />

        <input
          type="number"
          placeholder="Issued Supply (Visual Only)"
          value={tokenSupply}
          onChange={(e) => setTokenSupply(e.target.value)}
          className="p-2 rounded bg-[#111] border border-gray-700 text-white w-full"
        />

        <select
          value={tokenType}
          onChange={(e) => setTokenType(e.target.value)}
          className="p-2 rounded bg-[#111] border border-gray-700 text-white w-full"
        >
          <option value="Burnable">Burnable</option>
          <option value="Mintable">Mintable</option>
        </select>

        <div className="flex items-center gap-2">
          <label htmlFor="decimals" className="text-sm text-gray-400 w-32">
            Decimals: {tokenDecimals}
          </label>
          <input
            type="range"
            min="0"
            max="18"
            value={tokenDecimals}
            onChange={(e) => setTokenDecimals(Number(e.target.value))}
            className="w-full"
          />
        </div>

        <button
          onClick={handleCreateToken}
          className="bg-orange-500 hover:bg-orange-600 text-white px-4 py-2 rounded w-full"
        >
          Create Token
        </button>
      </div>

      {error && <p className="text-red-400 mt-2">{error}</p>}
    </div>
  );
};

export default TokenCreation;
